import './style.css';

function WhiteBox({ title, content, width, height }) {
  return (
    <div className="square" style={{ width: { width }, height: { height } }}>
      <h1 className="title">{{ title }}</h1>
      {{ content }}
    </div>
  );
}

WhiteBox.defaultProps = {
  width: 300,
  height: 600
}

export default WhiteBox;
